import React from 'react';
import './Home.css';
import Hero from '../components/home/Hero.js';
import Stats from '../components/home/Stats.js';
import Services from '../components/home/Services.js';
import Process from '../components/home/Process.js';
import Testimonials from '../components/home/Testimonials.js';
import WhyChooseUs from '../components/home/WhyChooseUs.js';
import TechStack from '../components/home/TechStack.js';
import Projects from '../components/home/Projects.js';
import CTA from '../components/home/CTA.js';

function Home() {
  return (
    <div className="home-page">
      <Hero />
      <Stats />
      <Services />
      <Process />
      <Testimonials />
      <WhyChooseUs />
      <TechStack />
      <Projects />
      <CTA />
    </div>
  );
}

export default Home;
